import React, { Component } from 'react';

class App extends Component {
	state = {
		msg: ['Hello']
	};
  render() {
    return (
    	<div>
    		<div>
    			{this.state.msg}
    		</div>
    		<input type="text" onChange={e => {
    			this.setState({UsrMsg: event.target.value});
    		}} />
    		<button onClick={e => {
    			e.preventDefault();
    		}} />
    	</div>
    )
  }
}

export default App;
